import React from 'react'
import { useState } from 'react'

export default function Register() {
  let [username, setUsername] = useState("");
  let [password, setPassword] = useState("");
  let [email, setEmail] = useState("");

  function handleSubmit(event) {
    event.preventDefault();
    alert (`register in with ${username} and ${password} and ${email}`);
  }

  function updateUsername(event) {
    setUsername(event.target.value);
  }
  function updatePassword(event){
    setPassword(event.target.value);
  }
  function updateEmail(event) {
    setEmail(event.target.value)
  }
  return (
    <div>
    <form onSubmit={handleSubmit}>
    <table className='table border border-3'>
    <thead>
    <tr>
      <th scope="col">Name</th>
      <th scope="col">Password</th>
      <th scope="col">Last</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
    <input type="text" className='m-5' onChange={updateUsername}></input>
    <input type="password" className='m-5' onChange={updatePassword}></input>
    <input type="email" onChange={updateEmail}></input>

    <input type="submit" className='m-5' value="Register"></input>
    </table>



    </form>
    </div>
  )
}
